import React from "react";
import './css/Header.scss';

export default function Header() {
    const token = localStorage.getItem("Token")
    const login = localStorage.getItem('login')

    return (
    <>
        <header className='header'>
            <div className="logo"></div>
            <h3 className="text-header">Электронная сервисная книжка "Мой Силант"</h3>
            <h3 className="number-phone">+7-8352-20-12-09</h3>
            <div className="telegram-icon"></div>
            {!token ? (
                <div className="button-authorization">Авторизация</div>
            ):(
                <div className="button-authorization">{login}</div>
            )}
            <button>

            </button>

        </header>
    </> 
   )

}
